import styled from 'styled-components';

export const Container = styled.div`
    width:100%;
    height:50px;
    background: #F0EEA5;
    border-top:5px solid #53934d;

    position: fixed;
    bottom: 0;

    display: flex;
    align-items: center;
    justify-content: center;

    span {
        color: #53934d;
    }
`
